      <h1>鈴木愛、１４アンダーで今季５勝目…２位は申ジエ</h1>
      <address>
        <time datetime="2019-11-03T06:19:00+00:00">03 Nov 2019, 06:19</time>
      </address>
      <p>　ゴルフ・樋口久子三菱電機レディース最終日（３日・埼玉武蔵丘ＧＣ＝６５８５ヤード、パー７２）――初日から首位の鈴木愛（２５）が５バーディー、１ボギーの６８で回り、通算１４アンダーで今季５勝目、ツアー通算１４勝目を挙げ、賞金１４４０万円を獲得した。２位は１打差で申ジエ（韓国）。２打差の３位に小祝さくら。</p>
